import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";

//pages & components
import Form from "./pages/Form";
import Navbar from "./components/Navbar";
import Blogs from "./pages/Blogs";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <div className="pages">
          <Routes>
            <Route path="/" element={<Form />} />
            <Route path="/" element={<Blogs />} />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
